import React from 'react'
import { useParams } from 'react-router-dom'
import { useQuery, gql } from '@apollo/client'

const product = gql`
  query getProduct {
    products {
      data {
        attributes {
          price
          name
          description
          slug
          image {
            data {
              attributes {
                url
              }
            }
          }
        }
      }
    }
  }
`

export default function SingleProduct() {
  return (
    <div>
      <h1>Single Product</h1>
    </div>
  )
}
